import React from "react";
import { Card, Input, Button, Form} from 'antd';

export default function DefaultValues() {
    const onFinish = (values) => {
        console.log('Success:', values);
      };

      const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
      };

    return (
        <>
            <Card bordered={false} style={{ width: '100%', marginBottom: '5px' }}>
                <div className="max-w-580-px mx-auto">
                    <div>
                        On the template page fill any information that may be relevant across all stages,
                        such information is found in completion procedures etc. Common information that can be
                        normally filled out in the template is the following:
                    </div>
                </div>
            </Card>
            <Card bordered={false} style={{ width: '100%', marginBottom: '1.5rem' }}>
                <Form
                    name="basic"
                    labelCol={{
                        span: 8,
                    }}
                    wrapperCol={{
                        span: 16,
                    }}
                    initialValues={{
                        remember: true,
                    }}
                    onFinish={onFinish}
                    onFinishFailed={onFinishFailed}
                    className="default-values-form"
                >
                    <Form.Item label="Field Engineer-Days & Nights" name="Field Engineer-Days & Nights"><Input /></Form.Item>
                    <Form.Item label="BHT - bottom hole temperature" name="BHT - bottom hole temperature"><Input /></Form.Item>
                    <Form.Item label="BHP - bottom hole pressure" name="BHP - bottom hole pressure"><Input /></Form.Item>
                    <Form.Item label="Frac Design" name="Frac Design"><Input /></Form.Item>
                    <Form.Item label="Plug Type" name="Plug Type"><Input /></Form.Item>
                    <Form.Item label="Plug Seat Technique" name="Plug Seat Technique"><Input /></Form.Item>
                    <Form.Item label="# of Clusters" name="# of Clusters"><Input /></Form.Item>
                    <Form.Item label="Perf Gun" name="Perf Gun"><Input /></Form.Item>
                    <Form.Item label="Description" name="Description"><Input /></Form.Item>
                    <Form.Item label="Perf Diameter" name="Perf Diameter"><Input /></Form.Item>
                    <Form.Item label="SPF - shots per foot" name="SPF - shots per foot"><Input /></Form.Item>
                    <Form.Item label="Field " name="Field "><Input /></Form.Item>
                    <Form.Item label="Acid " name="Acid "><Input /></Form.Item>
                    <Form.Item label="Base " name="Base "><Input /></Form.Item>
                    <Form.Item label="Fluid Type" name="Fluid Type"><Input /></Form.Item>
                    <Form.Item label="Proppant Data" name="Proppant Data"><Input /></Form.Item>
                    <Form.Item label="Pulsing Parameters" name="Pulsing Parameters"><Input /></Form.Item>
                    <Form.Item label="Pumping Summary " name="Pumping Summary "><Input /></Form.Item>

                    <Form.Item
                        wrapperCol={{
                        offset: 8,
                        span: 16,
                        }}
                    >
                        <Button type="primary" htmlType="submit">
                        Submit
                        </Button>
                    </Form.Item>
                    </Form>
            </Card>

        </>
    );
}
